// SPDX-License-Identifier:MIT
pragma solidity ^0.8;

contract A{
    event Log(string message);
    function foo()public virtual {
        emit Log("A.foo");
    }
    function bar()public virtual {
        emit Log("A.bar");
    }

}
contract B is A{
    function foo()public override{
        emit Log("B.foo");
        A.foo();
    }
}

